import React from 'react';

const ArtistList = ({ artists }) => {
  return (
    <div>
      <h2>Artists</h2>
      <ul>
        {artists.map((artist) => (
          <li key={artist.id}>{artist.name} - {artist.contact_details}</li>
        ))}
      </ul>
    </div>
  );
};

export default ArtistList;
